import style from './Card.module.css'
import comprobar from './Card.module.css'

export default function Card({ name, species, gender, image, onClose, status, origin }) {
	return (
	<div className={style.container}>
	<button class="" onClick="comprobar({{$tipusuario->id}});"></button>

	<img src={image} alt="foto"/>
	<h2> Name: {name} </h2>
	<h2> Status: {status} </h2> 
	<h2> Species: {species} </h2>
	<h2> Gender: {gender} </h2>
</div>
)	
function comprobar(id) {
         const ok = confirm("¿Quiere borrar el registro?");
         if (ok) {
             delete_row(id);
             destroy(id);
        };
}	

}
